import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

import reportWebVitals from './reportWebVitals';

function Card(){
  return (
    <div className="Card">
          <div className="card_detail">
            <img src="https://eloquentjavascript.net/img/cover.jpg" alt="image" className="card_img"/>
            <p className="card_title">Eloquent JavaScript, Second Edition</p>
            <span className="card_author">Marijn Haverbeke</span>
            <a href="http://eloquentjavascript.net/" target="blank">
              <button>Buy Now</button>
            </a>
          </div>    
    </div>
  )
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
      <h1>Books Store</h1>

        <Card/>


  </React.StrictMode>
);
